import React, { Component } from "react";
import Slider from "react-slick";

//array of objects
const slides = [
    {
        name: "Slide 1"
    },
    {
        name: "Slide 2"
    },
    {
        name: "Slide 3"
    }
]

class Carousel extends Component {
  render() {
    const settings = {
      className: "slides",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500,
      dots: true,
      arrows: true
    };
    return (
      <div>
        <Slider {...settings}>
          {slides.map((slide) => {
              return(
                  <div>
                      <h1>slide.name</h1>
                  </div>
              )
          })}

        </Slider>
      </div>
    );
  }
}

export default Carousel;
